public class OrderFeedback {
    private String company_code;
    private String order_id;

    private String order_generate_day;
    private String material_number;
    private String material_name;
    private String order_unit;
    private String number;
    private String plan_supply_number;
    private String plan_ship_day;
    private String plan_delivery_day;
    private String specified_delivery;



    public OrderFeedback() {
        // TODO Auto-generated constructor stub
    }
    public String getcompany_code() {
        return company_code;
    }
    public void setcompany_code(String company_code) {
        this.company_code = company_code;
    }
    public String getorder_id() {
        return order_id;
    }
    public void setorder_id(String order_id) {
        this.order_id = order_id;
    }

    public String getorder_generate_day() {
        return order_generate_day;
    }
    public void setorder_generate_day(String order_generate_day) {
        this.order_generate_day = order_generate_day;
    }

    public String getmaterial_number() {
        return material_number;
    }
    public void setmaterial_number(String material_number) {
        this.material_number = material_number;
    }

    public String getmaterial_name() {
        return material_name;
    }
    public void setmaterial_name(String material_name) {
        this.material_name = material_name;
    }

    public String getorder_unit() {
        return order_unit;
    }
    public void setorder_unit(String order_unit) {
        this.order_unit = order_unit;
    }

    public String getnumber() {
        return number;
    }
    public void setnumber(String number) {
        this.number = number;
    }

    public String getplan_supply_number() {
        return plan_supply_number;
    }
    public void setplan_supply_number(String plan_supply_number) {
        this.plan_supply_number = plan_supply_number;
    }

    public String getplan_ship_day() {
        return plan_ship_day;
    }
    public void setplan_ship_day(String plan_ship_day) {
        this.plan_ship_day = plan_ship_day;
    }

    public String getplan_delivery_day() {
        return plan_delivery_day;
    }
    public void setplan_delivery_day(String plan_delivery_day) {
        this.plan_delivery_day = plan_delivery_day;
    }

    public String getspecified_delivery() {
        return specified_delivery;
    }
    public void setspecified_delivery(String specified_delivery) {
        this.specified_delivery = specified_delivery;
    }



}
